import React from 'react';

function ContactDetails({ contact }) {
  return (
    <div className="container">
      <h1 className="heading">{contact.name}</h1>
      <div className="contact-info">
        <p>{contact.email}</p>
        <p>{contact.phone}</p>
      </div>
    </div>
  );
}

export default ContactDetails;
